DROP TABLE IF EXISTS `effettua`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `effettua` (
  `Locazione` varchar(20) NOT NULL,
  `Id` char(20) NOT NULL,
  `Matricola` char(10) NOT NULL,
  `Data_arrivo` date NOT NULL,
  `Num_notti` int NOT NULL,
  `Num_persone` int NOT NULL DEFAULT '1',
  PRIMARY KEY (`Locazione`,`Id`),
  KEY `IdPrenota_idx` (`Id`),
